import './Featured.css';

import { FontAwesomeIcon } from '@fortawesome/react-fontawesome';
import { faArrowLeft, faArrowRight, faBuilding, faHouse, faWarehouse } from '@fortawesome/free-solid-svg-icons';

import { Button, Col, Container, Row } from "react-bootstrap";

function Featured(){

    const ArraysOfHouse = [{
        id: 1,
        image: '',
        title: 'Roselands House',
        cost: '$ 35.000.000'
    }];
    const ArraysOfHouseOnMap = ArraysOfHouse.map((ArrayOfHouse) => 
    <Col lg = "4" md = "6" sm = "12" key = {ArrayOfHouse.id}>
        <img src = {ArrayOfHouse.image} className = "w-100 featured-image"/>

        <h4 className = "featured-title">{ArrayOfHouse.title}</h4>
        <h5 className = "featured-cost">{ArrayOfHouse.cost}</h5>

        <div className = "featured-person">

        </div>
    </Col>
    )

    return(
        <Container fluid>
            <Container>
                <Row class = "d-flex align-items-center">
                    <Col lg = "4" md = "6" sm = "12" class = "featured-header">
                        <h5 className = "featured-uptitle">Our Recommendation</h5>
                        <h1>Featured House</h1>
                    </Col>

                    <Col lg = "4" md = "6" sm = "12" className = "featured-buttons">
                        <Button variant='success'><FontAwesomeIcon icon={ faHouse }/> House</Button>
                        <Button variant='secondary'><FontAwesomeIcon icon={ faWarehouse }/> Villa</Button>
                        <Button variant='secondary'><FontAwesomeIcon icon={ faBuilding }/> Apartment</Button>
                    </Col>

                    <Col lg = "4" md = "6" sm = "12" className = "featured-pointers"> 
                        <Button variant='success'> <FontAwesomeIcon icon={ faArrowLeft }/> </Button>
                        <Button variant='secondary'> <FontAwesomeIcon icon={ faArrowRight }/> </Button>
                    </Col>
                </Row>

                <Row>
                    {ArraysOfHouseOnMap}
                </Row>
            </Container>
        </Container>
    )
}

export default Featured;
